import React from "react";

const TableCell = ({
   Renderer,
   isNearest,
   cellMouseEnter,
   cellMouseLeave,
   ...props
}) => {
   let style = isNearest ? { backgroundColor: "aqua" } : null;
console.log(typeof cellMouseLeave)
   return (
      <td
         style={style}
         onMouseEnter={cellMouseEnter}
         onMouseLeave={() => cellMouseLeave(style)}
      >
         <Renderer {...props} />
      </td>
   );
};

export default TableCell;
